module Main where

digits = ["","","","",""]

{-
start at 5
1 2 3
4 5 6
7 8 9
g-}
move 'U' here = case here of
  4   -> 1
  5   -> 2
  6   -> 3
  7   -> 4
  8   -> 5
  9   -> 6
  a@_ -> a
move 'L' here = case here of
  2   -> 1
  3   -> 2
  5   -> 4
  6   -> 5
  8   -> 7
  9   -> 8
  a@_ -> a
move 'D' here = case here of
  1   -> 4
  2   -> 5
  3   -> 6
  4   -> 7
  5   -> 8
  6   -> 9
  a@_ -> a
move 'R' here = case here of
  1   -> 2
  2   -> 3
  4   -> 5
  5   -> 6
  7   -> 8
  8   -> 9
  a@_ -> a

main = print $ map (foldl (flip move) 5) digits
